import React, { Component } from 'react';
import { Link, withRouter } from 'react-router-dom';

class Page_header extends Component {

    render() {

        let HeaderTitle = this.props.headertitle;
        let publicUrl = process.env.PUBLIC_URL+'/'

        const { location } = this.props;

        return (
            <div className="page-title-area d-flex align-items-center bg_cover" style={{backgroundImage: 'url(assets/images/page-title-bg.jpg)'}}>
                <div className="container">
                    <div className="row">
                        <div className="col-lg-12">
                            <div className="page-title-content text-center">
                                <h3 className="title">{ HeaderTitle }</h3>
                                <nav aria-label="breadcrumb">
                                    <ol className="breadcrumb">
                                        <li className="breadcrumb-item" itemprop="itemListElement" itemscope itemtype="http://schema.org/ListItem"><Link to="/" itemprop="item">Home</Link></li>
                                       {location.pathname !== '/blog' && location.pathname !== '/contact-us' && location.pathname !== '/hardware-support' && location.pathname !== '/software-support' && location.pathname !== '/network-support' && location.pathname !== '/cloud-support' && location.pathname !== '/cloud-support' && location.pathname !== '/helpdesk-support' && location.pathname !== '/quickbooks-support' && location.pathname !== '/aol-mail-login-support' && location.pathname !== '/email-support' && location.pathname !== '/hardware-maintenance-and-support-services' && location.pathname !== '/best-software-support-services' && location.pathname !== '/best-network-support-services' && location.pathname !== '/best-cloud-services' && location.pathname !== '/helpdesk-support-services' && location.pathname !== '/quickbooks-support-services' && location.pathname !== '/email-support-services' && <li itemprop="itemListElement" itemscope itemtype="http://schema.org/ListItem" className="breadcrumb-item"><Link itemprop="item" to="/blog">Blog</Link></li>}
                                       {location.pathname !== '/blog' && location.pathname !== '/contact-us' && location.pathname !== '/blog/aol-mail-295' && location.pathname !== '/blog/aol-mail-295-aol-email-login-error-support' && location.pathname !== '/blog/automating-data-entry-quickbooks-online' && location.pathname !== '/blog/aol-mail-not-working-on-iphone' && location.pathname !== '/blog/aol-mail-295-download' && location.pathname !== '/blog/recover-aol-forgotten-mail-password' && location.pathname !== '/blog/how-to-recover-aol-mail' && location.pathname !== '/blog//quickbooks-2020-software' && location.pathname !== '/blog/login-to-aol-mail-in-windows-10' && location.pathname !== '/blog/intuit-quickbook-online-version' && location.pathname !== '/blog/setting-up-and-managing-an-aol-mail-account' && location.pathname !== '/blog/how-can-you-create-aol-mail-account' && location.pathname !== '/blog/increase-productivity-results-with-aol-mail' && location.pathname !== '/blog/what-does-negative-open-balance-mean-in-quickbooks' && location.pathname !== '/blog/how-to-download-aol-mail-to-computer' && location.pathname !== '/blog/what-is-quickbooks-and-how-to-use-quickbooks-intuit' && location.pathname !== '/blog/why-aol-mail-295-is-not-working-on-iPhone-nd-how-to-solve-it' && location.pathname !== '/blog/how-to-perform-account-reconciliations-using-the-online-version-of-quickbooks' && location.pathname !== '/blog/the-evolution-of-aol-mail-295' && location.pathname !== '/blog/how-to-repair-aol-mail-295-not-receiving-email' && location.pathname !== '/blog/how-to-use-quickbooks-to-create-invoices' && <li className="breadcrumb-item" itemprop="itemListElement" itemscope itemtype="http://schema.org/ListItem"><Link to="/" itemprop="item" >Services</Link></li>}
                                        <li className="breadcrumb-item active" aria-current="page" itemprop="itemListElement" itemscope itemtype="http://schema.org/ListItem">{ HeaderTitle }</li>     
                                    </ol>
                                </nav>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default withRouter(Page_header);
